import { Link } from "react-router-dom";
import React from "react";
import MedianCol from "./images/MedianCol.png";


function Header() {
    const style = {
        height:{
            height: '100%'
        },
        global: {
            height: "100px",
            backgroundColor: "gray",

        },
        image: {
            height: '50%'
        }
    }
    return (
        <header style={style.global}>
            <div className="container" style={style.global}>

                <div className="row" style={style.height}>
                    <div className="col-sm-4" style={style.height}>

                        <img src={MedianCol} alt="app logo" style={style.image} />
                    </div>
                    <div className="col-sm-4" style={style.height}></div>
                    <div className="col-sm-1 align-self-center mr-1" style={style.height}>
                        <Link to="/home">MedianCOL </Link>
                    </div>
                    <div className="col-sm-1 align-self-center mr-1" style={style.height}><Link to="/projects"> About</Link></div>
                    <div className="col-sm-1 align-self-center" style={style.height}><Link to="/Contact"> LivingCost</Link></div>

                </div>

            </div>

        </header>
    )
}

export default Header;
